import React from 'react';
import '../assets/css/Home.css';

const TopBar = () => {
  return (
    <div className="top-bar">
      <div className="contact-info">
        <span>Email: info@example.com</span>
        <span>Phone: 888-123-4567</span>
      </div>
      <div className="social-icons">
        <a href="#">Facebook</a>
        <a href="#">Twitter</a>
        <a href="#">LinkedIn</a>
      </div>
    </div>
  );
};

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="logo">Brixel</div>
      <ul className="nav-links">
        <li><a href="#">Home</a></li>
        <li><a href="#">About</a></li>
        <li><a href="#">Services</a></li>
        <li><a href="#">Shop</a></li>
        <li><a href="#">Contact</a></li>
      </ul>
    </nav>
  );
};

const HeroSection = () => {
  return (
    <section className="hero-section">
      <div className="hero-text">
        <h1>Create With Heart<br />Build With Mind</h1>
        <p>
          Keep the whole family comfortable with building construction. We provide 24/7 emergency water extraction services in Los Angeles.
        </p>
        <button className="cta-button">Get Free Quote</button>
      </div>
      <div className="hero-image">
        <img src="../assets/images/my.jpg" alt="Hero" />
      </div>
    </section>
  );
};

const ServicesSection = () => {
  return (
    <section className="services-section">
      <h2>Let's Build Your Dream Together</h2>
      <div className="services">
        <div className="service">
          <h3>Building Renovation</h3>
          <p>Professional renovation services to upgrade your building.</p>
        </div>
        <div className="service">
          <h3>Building Construction</h3>
          <p>We specialize in reliable and efficient construction.</p>
        </div>
        <div className="service">
          <h3>Architecture Design</h3>
          <p>Creative designs tailored to your vision.</p>
        </div>
        <div className="service">
          <h3>Building Maintenance</h3>
          <p>Comprehensive maintenance for lasting value.</p>
        </div>
      </div>
    </section>
  );
};

const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer-content">
        <div className="about-footer">
          <h3>About Us</h3>
          <p>
            We are a trusted construction company offering services to make your dream projects come true. Let's build something amazing together!
          </p>
        </div>
        <div className="quick-links">
          <h3>Quick Links</h3>
          <ul>
            <li><a href="#">Home</a></li>
            <li><a href="#">About</a></li>
            <li><a href="#">Services</a></li>
            <li><a href="#">Contact</a></li>
          </ul>
        </div>
        <div className="contact-footer">
          <h3>Contact Us</h3>
          <p>Email: info@example.com</p>
          <p>Phone: 888-123-4567</p>
          <p>Address: Los Angeles, CA</p>
        </div>
      </div>
      <div className="footer-bottom">
        <p>&copy; 2025 Brixel. All rights reserved.</p>
      </div>
    </footer>
  );
};

const Home = () => {
  return (
    <div className="home-container">
      <header className="header">
        <TopBar />
        <Navbar />
      </header>

      <HeroSection />

      <ServicesSection />

      <Footer />
    </div>
  );
};

export default Home;
